import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import 'tachyons';
import { nbaPlayers } from './nbaPlayers';
import {robots} from './robots';

import * as serviceWorker from './serviceWorker';

// ReactDOM.render(<App />, document.getElementById('root'));

ReactDOM.render(
   <div>
      <Card rank={nbaPlayers[0].rank} name={nbaPlayers[0].name} team={nbaPlayers[0].team} />
      <Card rank={nbaPlayers[1].rank} name={nbaPlayers[1].name} team={nbaPlayers[1].team} />
      <Card rank={nbaPlayers[2].rank} name={nbaPlayers[2].name} team={nbaPlayers[2].team} />
   </div>
   , document.getElementById('root'));



// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
